    minWidth: 100
  },
  {
    id: "puts_theta",
    label: "Puts Theta",
    minWidth: 100
  }
];

function createData(
  call_bid,
  call_ask,
  call_volume,
  call_iv,
  call_delta,
  call_gamma,
  call_vega,
  call_theta,
  strike,
  expiry,
  puts_bid,
  puts_ask,
  puts_volume,
  puts_iv,
  puts_delta,
  puts_gamma,
  puts_vega,
  puts_theta
) {
  return {
    call_bid,
    call_ask,
    call_volume,
    call_iv,
    call_delta,
    call_gamma,
    call_vega,
    call_theta,
    strike,
    expiry,
    puts_bid,
    puts_ask,
    puts_volume,
    puts_iv,
    puts_delta,
    puts_gamma,
